import styled from "styled-components";
import Dialog from "./Dialog";

const Tag = styled.div`
  border: 1px solid black;
  padding: 10px 20px;
  margin: 8px 8px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
`;
const Div = styled.div`
  display: flex;
  flex-direction: column;
`;
const Font = styled.span`
    font-size: 12px;
    margin: 10px 0;
`;

function AddTab(e) {
    console.log('添加一个内容')
    e.stopPropagation()
    console.log(e);
}

export default function Tags(props) {
    return (
        <Tag onClickCapture={(e) => {
            AddTab(e)
        }}>
            <Div>
                <p>{props.name}</p>
                <Font>{props.tag}</Font>
            </Div>
            <div>开始</div>
        </Tag>
    )
}
